// src/components/BarbeiroSelector.js
import React from 'react';
import commonStyles from './Selector.module.css';

const BarbeiroSelector = ({ barbeiros, selectedBarbeiroId, onSelect }) => {
  return (
    <div>
      <p className={commonStyles.selecionarBarbeiro}>Selecione o Barbeiro</p>
      <ul>
        {barbeiros.map(barbeiro => (
          <li
            key={barbeiro.id}
            onClick={() => onSelect(barbeiro.id)}
            className={selectedBarbeiroId === barbeiro.id ? styles.selected : styles.unselected}
          >
            {barbeiro.nomeBarbeiro}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default BarbeiroSelector;
